import React, {Component} from 'react';
import './Footer.css';

class Footer extends Component {
    render() {
        let date = new Date();
        let thisYear = date.getFullYear();
        let firstYear = '2019';

        return (
            <div className="Footer">
                <p>&#x24B8; {firstYear} {date.getFullYear()}, Lift Weights by Michelle Duer</p>
            </div>
        );
    }
}

export default Footer;
